import React from 'react';
import './about.css';
import {useEffect} from 'react';

// Imports from MUI lib
import Box from '@mui/material/Box';
import CssBaseline from "@mui/material/CssBaseline";
import Container from "@mui/material/Container";
import Typography from "@mui/material/Typography";
import myImg from './images/about.jpg';
import Paper from '@mui/material/Paper';
import Avatar from '@mui/material/Avatar';


const AboutPage = () => {

    // The title will update at every refresh
    useEffect(() => {
        document.title = 'About Page';
    }, []);

    // Creating welcome cards for the team members
    const bull = (
        <Box
            component='span'
            sx={{display: 'inline-block', mx: '4px', transform: 'scale(1)'}}
        >
            â€¢
        </Box>
    );

    return (
        <div className='about-container'>
            <Paper className='about-card' elevation={8}>
                <Avatar className='avatar' alt='Your Name' src='your-profile-picture.jpg' />
                <div className='about-content'>
                    <Typography variant='h4' gutterBottom>
                        About Me
                    </Typography>
                    <Typography variant='body1' paragraph>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis vehicula aliquet
                        dignissim. Maecenas condimentum, mi vel sagittis semper, turpis justo elementum
                        neque, ac aliquet elit purus at justo. Integer ultricies mi in risus interdum
                        hendrerit.
                    </Typography>
                    <Typography variant='h5' gutterBottom>
                        Tech Stack
                    </Typography>
                    <Typography variant='body1' paragraph>
                        - React.js
                        <br />
                        - Node.js
                        <br />
                        - Express.js
                        <br />
                        - MongoDB
                        <br />
                        {/* Add more technologies as needed */}
                    </Typography>
                    <Typography variant='h5' gutterBottom>
                        Contact Details
                    </Typography>
                    <Typography variant='body1'>
                        Email: your.email@example.com
                        <br />
                        LinkedIn: linkedin.com/in/your-username
                        <br />
                        Twitter: @your_twitter
                        {/* Add more contact details as needed */}
                    </Typography>
                </div>
            </Paper>
        </div>
    );
}
export default AboutPage;
